import Nav from 'react-bootstrap/Nav';
import '../css/Navbar.css';
import React, {Component} from 'react';

const _nav_items_left = [
    {title: "Hem",              id: "home"},
    {title: "Pub & Event",      id: "events"},
    {title: "Klubbmästeriet",   id: "km"},
    {title: "Kontakt",          id: "contact"}
];

const _nav_items_right = [
    {title: "Logga in", id: "login"},
];

class Navbar extends Component {

    constructor(props){
        super(props);

        let handleClick = this.handleClick.bind(this, 'Parameter');
    }


    render(){
        this.content_left = _nav_items_left.map((item) => NavItem(item.title, item.id));
        this.content_right = _nav_items_right.map((item) => NavItem(item.title, item.id));

        return (
            <Nav className={"clearfix"}>
                <div className={"left"}>
                    {this.content_left}
                </div>

                <div className={"right"}>
                    {this.content_right}
                </div>
            </Nav>
        )
    }

}

function NavItem(title, id){
    return (
        <Nav.Item>
            <Nav.Link onSelect={(e) => this.handleClick(e)} activeKey={id} href={"#"+id}> {title} </Nav.Link>
        </Nav.Item>
    )
}

export default Navbar
